import { Component } from "@angular/core";
import { Writeup, WriteupService } from "src/app/services/writeup.service";

@Component({
  selector: "app-home",
  template: ` <p>home works! {{ writeups }}</p> `,
  styles: [],
})
export class HomeComponent {
  writeups: Writeup[] = [];

  constructor(private writeupService: WriteupService) {}

  ngOnInit(): void {
    this.writeupService.getWriteups().subscribe((writeups) => {
      this.writeups = writeups;
    });
  }
}
